export function Paginado({recipes,recipeForPage,paginado}){
    const pageNumber= [1,2,7];
    for (let i = 0; i < Math.ceil(recipes/recipeForPage); i++) {
        pageNumber.push(i);
    }
    return(
        <nav>
            <ul>
                {
                    pageNumber.map(nume =>(
                        <li>
                            <a onClick={() => paginado(nume)}>{2}</a>
                        </li>
                    ))
                }
            </ul>
        </nav>
    )

}
